import csv
import json

train = []


with open('train.csv') as csvfile:
	readCSV = csv.reader(csvfile, delimiter=',')
	next(readCSV)  # Skip header line
	for row in readCSV:
		k = []

		k.append(row[3]) # visitor id
		k.append(channel[row[0]]) # channel grouping
		k.append(float(row[1][4:6])/12.0) # date:month
		k.append(float(row[1][6:])/31.0) # date:day

		geo = json.loads(row[4])
		if "continent" in geo:
			k.append(continent[geo["continent"]])
		else:
			k.append("-1")
		if "subContinent" in geo:
			k.append(subcontinent[geo["subContinent"]])
		else:
			k.append("-1")
